import PropTypes from 'prop-types';

const Filter = ({ value, onChage }) => (
  <div>
    <label>
      Find contacts of name
      <input type="text" value={value} onChange={onChage} />
    </label>
  </div>
);

Filter.propTypes = {
  value: PropTypes.string.isRequired,
  onChage: PropTypes.func.isRequired,
};

export default Filter;
